deOwner(bytes32node,bytes32label,addressowner);functionsetResolver(bytes32node,addressresolver);functionsetTTL(bytes32node,uint64ttl);//Loggedwhentheownerofanodeassignsanewownertoasubnode.eventNewOwner(bytes32indexednode,bytes32indexedlabel,addressowner);//Loggedwhentheownerofanodetransfersownershiptoanewaccount.eventTransfer(bytes32indexednode,addressowner);//Loggedwhentheresolverforanodechanges.eventNewResolver(bytes32indexednode,addressresolver);//LoggedwhentheTTLofanodechangeseventNewTTL(bytes32indexednode,uint64ttl);}\"}},\"settings\":{\"optimizer\":{\"enabled\":true,\"runs\":200},\"outputSelection\":{\"*\":{\"\":[\"legacyAST\"],\"*\":[\"abi\",\"metadata\",\"devdoc\",\"userdoc\",\"evm.legacyAssembly\",\"evm.bytecode\",\"evm.deployedBytecode\",\"evm.methodIdentifiers\",\"evm.gasEstimates\"]}}}}","source":{"browser/Untitled4.sol":{"content":"import \"github.com/ethereum/ens/contracts/ENS.sol\"; contract test7 {}"},"github.com/ethereum/ens/contracts/ENS.sol":{"content":"pragma solidity ^0.4.0;\n\nimport './AbstractENS.sol';\n\n/**\n * The ENS registry contract.\n */\ncontract ENS is AbstractENS {\n    struct Record {\n        address owner;\n        address resolver;\n        uint64 ttl;\n    }\n\n    mapping(bytes32=>Record) records;\n\n    // Permits modifications only by the owner of the specified node.\n    modifier only_owner(bytes32 node) {\n        if (records[node].owner != msg.sender) throw;\n        _;\n    }\n\n    /**\n     * Constructs a new ENS registrar.\n     */\n    function ENS() {\n        records[0].owner = msg.sender;\n    }\n\n    /**\n     * Returns the address that owns the specified node.\n     */\n    function owner(bytes32 node) constant returns (address) {\n        return records[node].owner;\n    }\n\n    /**\n     * Returns the address of the resolver for the specified node.\n     */\n    function resolver(bytes32 node) constant returns (address) {\n        return records[node].resolver;\n    }\n\n    /**\n     * Returns the TTL of a node, and any records associated with it.\n     */\n    function ttl(bytes32 node) constant returns (uint64) {\n        return records[node].ttl;\n    }\n\n    /**\n     * Transfers ownership of a node to a new address. May only be called by the current\n     * owner of the node.\n     * @param node The node to transfer ownership of.\n     * @param owner The address of the new owner.\n     */\n    function setOwner(bytes32 node, address owner) only_owner(node) {\n        Transfer(node, owner);\n        records[node].owner = owner;\n    }\n\n    /**\n     * Transfers ownership of a subnode sha3(node, label) to a new address. May only be\n     * called by the owner of the parent node.\n     * @param node The parent node.\n     * @param label The hash of the label specifying the subnode.\n     * @param owner The address of the new owner.\n     */\n    function setSubnodeOwner(bytes32 node, bytes32 label, address owner) only_owner(node) {\n        var subnode = sha3(node, label);\n        NewOwner(node, label, owner);\n        records[subnode].owner = owner;\n    }\n\n    /**\n     * Sets the resolver address for the specified node.\n     * @param node The node to update.\n     * @param resolver The address of the resolver.\n     */\n    function setResolver(bytes32 node, address resolver) only_owner(node) {\n        NewResolver(node, resolver);\n        records[node].resolver = resolver;\n    }\n\n    /**\n     * Sets the TTL for the specified node.\n     * @param node The node to update.\n     * @param ttl The TTL in seconds.\n     */\n    function setTTL(bytes32 node, uint64 ttl) only_owner(node) {\n        NewTTL(node, ttl);\n        records[node].ttl = ttl;\n    }\n}"},"github.com/ethereum/ens/contracts/AbstractENS.sol":{"content":"pragma solidity ^0.4.0;\n\ncontract AbstractENS {\n    function owner(bytes32 node) constant returns(address);\n    function resolver(bytes32 node) constant returns(address);\n    function ttl(bytes32 node) constant returns(uint64);\n    function setOwner(bytes32 node, address owner);\n    function setSubnodeOwner(bytes32 node, bytes32 label, address owner);\n    function setResolver(bytes32 node, address resolver);\n    function setTTL(bytes32 node, uint64 ttl);\n\n    // Logged when the owner of a node assigns a new owner to a subnode.\n    event NewOwner(bytes32 indexed node, bytes32 indexed label, address owner);\n\n    // Logged when the owner of a node transfers ownership to a new account.\n    event Transfer(bytes32 indexed node, address owner);\n\n    // Logged when the resolver for a node changes.\n    event NewResolver(bytes32 indexed node, address resolver);\n\n    // Logged when the TTL of a node changes\n    event NewTTL(bytes32 indexed node, uint64 ttl);\n}"}},"optimization":true,"missingInputs":[],"result":"{\"contracts\":{\"browser/Untitled4.sol\":{\"test7\":{\"abi\":[],\"devdoc\":{\"methods\":{}},\"evm\":{\"bytecode\":{\"linkReferences\":{},\"object\":\"60606040523415600e57600080fd5b603580601b6000396000f3006060604052600080fd00a165627a7a72305820d82d78e0a1112b11a4b81c3f09951bcccbfc880e15c1da17167745d70179bbc60029\",\"opcodes\":\"PUSH1 0x60 PUSH1 0x40 MSTORE CALLVALUE ISZERO PUSH1 0xE JUMPI PUSH1 0x0 DUP1 REVERT JUMPDEST PUSH1 0x35 DUP1 PUSH1 0x1B PUSH1 0x0 CODECOPY PUSH1 0x0 RETURN STOP PUSH1 0x60 PUSH1 0x40 MSTORE PUSH1 0x0 DUP1 REVERT STOP LOG1 PUSH6 0x627A7A723058 KECCAK256 0xd8 0x2d PUSH25 0xE0A1112B11A4B81C3F09951BCCCBFC880E15C1DA17167745D7 ADD PUSH26 0xBBC6002900000000000000000000000000000000000000000000 \",\"sourceMap\":\"52:17:0:-;;;;;;;;;;;;;;;;;\"},\"deployedBytecode\":{\"linkReferences\":{},\"object\":\"6060604052600080fd00a165627a7a72305820d82d78e0a1112b11a4b81c3f09951bcccbfc880e15c1da17167745d70179bbc60029\",\"opcodes\":\"PUSH1 0x60 PUSH1 0x40 MSTORE PUSH1 0x0 DUP1 REVERT STOP LOG1 PUSH6 0x627A7A723058 KECCAK256 0xd8 0x2d PUSH25 0xE0A1112B11A4B81C3F09951BCCCBFC880E15C1DA17167745D7 ADD PUSH26 0xBBC6002900000000000000000000000000000000000000000000 \",\"sourceMap\":\"52:17: